import React from "react";

export const Notes = ({ notes }) => {
  return (
    <ul class="list-group">
      {notes.map(note => (
        <li class="list-group-item note" key={note.id}>
          {note.title}

          <button type="button" class="btn btn-outline-danger btn-sm">
            &times;
          </button>
        </li>
      ))}
    </ul>
  );
};
